# $1: proposer & payer & authorizer: the single SwapPair account with multiple keys
function build_and_sign1() {
  flow-c1 transactions build ./stage_hex_encoded_contract.cdc "SwapPair" "" \
    --proposer $1 \
    --proposer-key-index 1 \
    --payer $1 \
    --authorizer $1 \
    --filter payload \
    --save ./transactions/2024/2024-08-26/Swap/SwapPair-Instances/$1.build \
    --network mainnet \
    --gas-limit 9999 \
    --yes

  if [ $? -eq 0 ];then
    flow-c1 transactions sign ./transactions/2024/2024-08-26/Swap/SwapPair-Instances/$1.build \
      --signer $1 \
      --filter payload \
      --save ./transactions/2024/2024-08-26/Swap/SwapPair-Instances/$1.signed1 \
      --network mainnet \
      --yes
  else
    echo "!!!! Build $1 failed ...."
    rm -f ./transactions/2024/2024-08-26/Swap/SwapPair-Instances/$1.build
    touch ./transactions/2024/2024-08-26/Swap/SwapPair-Instances/failed.$1
  fi
}

# For Flow/stFlow stableswap pair only (the staging code is different)
