function multi_build_and_sign1() {
  for i in ${!pair_vec[@]}; do
    (echo "Build $i ..." && build_and_sign1 ${pair_vec[$i]}) &
    if [ $(((i+1) % $CONCURRENCY)) -eq 0 ]; then
      sleep 2
    fi
  done

  build_and_sign1_stable_pair_stflow &
}

function multi_send() {
  for i in ${!pair_vec[@]}; do
    (echo "Send $i ..." && flow-c1 transactions send-signed ./transactions/2024/2024-08-26/Swap/SwapPair-Instances/${pair_vec[$i]}.signed2 --network mainnet --yes) &
    if [ $(((i+1) % $CONCURRENCY)) -eq 0 ]; then
      sleep 2
    fi
  done

  flow-c1 transactions send-signed ./transactions/2024/2024-08-26/Swap/SwapPair-Instances/0xc353b9d685ec427d.signed2 --network mainnet --yes &
}

